void run(void){
  int w,h;
  scanf("%d%d",&w,&h);
  int *p=(int *)calloc(w,sizeof(int));
  int i;
  for(i=0;i<w;i++) scanf("%d",p+i);
  int *q=(int *)calloc(h,sizeof(int));
  for(i=0;i<h;i++) scanf("%d",q+i);
  srand((unsigned)time(NULL));
  sort(p,w);
  sort(q,h);
  int x=0;
  int y=0;
  int64 sum=0;
  while(x<w && y<h){
    if(p[x]<=q[y]){
      sum+=(int64)p[x++]*(h+1-y);
    } else {
      sum+=(int64)q[y++]*(w+1-x);
    }
  }
  while(x<w) sum+=p[x++];
  while(y<h) sum+=q[y++];
  printf("%lld\n",sum);
}
